import React from "react";
import "../styles.css";

const About = () => {
  return (
    <section className="about">
      <div className="about-card">
        <h2>About Me</h2>
        <p> Heyy!! I'm Suma Sarakadam, a Frontend developer with a passion 
                for creating amazing digital experiences.I love solving problems and
                 making things look awesome.I'm excited to start my career in tech and 
                 contribute my skillsand enthusiasm to a team</p>
        <a href="https://www.linkedin.com/in/saisuma-sarakadam-314563289" target="_blank"><button className="about-btn" >Learn More</button></a>
      </div>
    </section>
  );
};

export default About;
